getFaqText:function(a){return"<DIV ID="+a+" ALIGN=JUSTIFY STYLE=\"line-height: 1.5; margin: 10px; font-size: 12px; font-family: sans-serif;\">\n\t\t\t\t<H1>FAQ - Domande frequenti relative alla Fatturazione Elettronica Attiva</H1>\n\t\t\t\t<OL>\n\t\t\t\t\t<LI><b>Se sbaglio una fattura all'ospite e l'ho già inviata, che cosa devo fare?</B><BR>\n\t\t\t\t\tNota di credito ed una nuova fattura.<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>Quali documenti vanno inviati?</B><BR>\n\t\t\t\t\t•\tTD01 Fattura<BR>\n\t\t\t\t\t•\tTDO2 Acconto/Anticipo su fattura<BR>\n\t\t\t\t\t•\tTDO3 Acconto/Anticipo su parcella<BR>\n\t\t\t\t\t•\tTD04 Nota di Credito<BR>\n\t\t\t\t\t•\tTD05 Nota di Debito<BR>\n\t\t\t\t\t•\tTDO6 Parcella<BR>\n\t\t\t\t\t•\tTD20 Autofattura<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>E' necessario inviare le fatture in formato cartaceo?</B><BR>\n\t\t\t\t\tSdI recapita la fattura elettronica al cessionario/committente mettendola a disposizione nella sua area riservata del sito web dell'Agenzia delle entrate. Comunque, il cedente/prestatore consegna direttamente al cliente consumatore finale una copia informatica o analogica della fattura elettronica, comunicando contestualmente che il documento è messo a sua disposizione da Sdi nell'area riservata del sito web dell'Agenzia delle entrate.<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>Gli enti pubblici continueranno ad utilizzare le notifiche (accettazione / rifiuto / decorrenza termini)?</B><BR>\n\t\t\t\t\tSi<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>Quali sono i termini per l'invio delle fatture attive a SdI?</B><BR>\n\t\t\t\t\tEntro 10 giorni.<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>Se viene predisposta ed inviata al cliente una fattura in forma diversa dal quella dell’xml cosa succede?</B><BR>\n\t\t\t\t\tIn questo caso le modalità sono diverse da quelle previste per il Sistema di interscambio, quindi, come previsto dal provvedimento del 30 aprile 2018, tale fattura si considera non emessa, con conseguenti sanzioni (art. 6 DLgs. 471/1997) a carico del fornitore e con l’impossibilità di detrazione dell’IVA a carico del cliente.<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>Il processo di fatturazione elettronica come incide sulle fatture differite?</B><BR>\n\t\t\t\t\tNella guida del 27 settembre 2018, l’Agenzia delle Entrate ha affermato che restano valide le regole che consentono di predisporre la c.d. fattura differita entro il 15 del mese successivo a quello di effettuazione dell’operazione, nel rispetto delle disposizioni previste dall’art.21 c.4 lett. a) del DPR 633/72. Da un punto di vista operativo, questa disposizione può consentire all’utente di avere più tempo per predisporre e trasmettere allo SDI la fattura elettronica, fermo restando l’obbligo di rilasciare al cliente – al momento dell’operazione – un documento di trasporto o altro documento equipollente anche su carta.<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>In caso di fattura scartata dallo Sdi come ci si può comportare?</B><BR>\n\t\t\t\t\tL’Agenzia delle Entrate si è espressa in merito nella circolare 13/E/2018, in particolare ha affermato che nel caso in cui la fattura precedentemente trasmessa sia stata scartata dal Sistema di interscambio, la fattura va inviata nuovamente, entro cinque giorni dalla notifica di scarto, preferibilmente con la medesima data e numero del documento originario.<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t\t<LI><b>E’ obbligatorio applicare il bollo virtuale?</B><BR>\n\t\t\t\t\tSì, ove previsto, è obbligatorio l’assolvimento virtuale del bollo. Dal 1° gennaio 2015, i contribuenti che scelgono di assolvere il pagamento dell’imposta di bollo in modo virtuale, sono tenuti a presentare una dichiarazione contenente il numero degli atti e documenti emessi, distinti per voce di tariffa, utilizzando il nuovo modello di autorizzazione.<BR>\n\t\t\t\t\t<BR>\n\t\t\t\t</OL>\n\t\t\t</DIV>"},
